description:
Serious Moonlight (2009)  

Verenigde Staten
Komedie
84 minuten

geregisseerd door Cheryl Hines
met Meg Ryan, Timothy Hutton en Kristen Bell

De machtige advocate Louise trekt even naar haar buitenhuisje op het platteland om een beetje uit te rusten. Hier ontdekt ze dat haar echtgenoot van plan is haar in te ruilen voor een jongere dame. In een eerste opwelling bindt ze hem vast en besluit hem zo te gijzelen totdat hij aangeeft serieus te willen werken aan hun huwelijk. Maar dan lopen de zaken pas echt goed uit de hand.

